import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { solid, regular, brands, icon } from '@fortawesome/fontawesome-svg-core/import.macro'

function About() {
  return (
    <Container className="about-section">
      <Row>
        <Col sm={8}>
            <h1>Nice to meet you, I'm Anika â€” A final year data analytics student.</h1>
            <h4>I love creating! <br /> Ranging from code to digital artwork, I am passionate about beautifying the end recipient's experience.</h4>
            <br />
            <h4>Connect with me</h4>
            <div className="effect amiens">
                <div className="buttons">
                    <a href="./Contact" className="contact-page" title="Email me!"><i className="fa fa-google" aria-hidden="true"></i></a>
                    <a href="www.instagram.com" className="insta"><i className="fa fa-instagram" aria-hidden="true"></i></a>
                    <a href="www.linkedin.com" className="linkedin" title="Connect with me on Linked In"><i class="fa fa-linkedin" aria-hidden="true"></i></a>
                    <FontAwesomeIcon icon="fa-brands fa-google" />
                </div>
            </div>

        </Col>
        <Col sm={4}>

        </Col>
      </Row>
    </Container>
  );
};

export default About;
